import React, { Component, Fragment } from 'react';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import StyledTableCell from '@material-ui/core/StyledTableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
//import StyledTableCell  from '@material-ui/core/StyledTableCell'
import Paper from '@material-ui/core/Paper';
import axios from 'axios';


class ParkingSpaceListView extends Component {


    state = {
        parkings : []
    }

    componentDidMount(){

        axios.get('https://reone.beta.webenza.in/property/')
        .then( response => {
            //console.log(response);
            this.setState({parkings : response.data});

        })
    }

    render(props) {

        const parkings = this.state.parkings;
        console.log(parkings)

        return (
            <Fragment>
                <TableContainer component={Paper}>
                    <Table aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <StyledTableCell>Parking Space Name</StyledTableCell>
                            <StyledTableCell align="right">Status</StyledTableCell>
                            <StyledTableCell align="right">Type</StyledTableCell>
                            <StyledTableCell align="right">Operation Time</StyledTableCell>
                            <StyledTableCell align="right">Tariff</StyledTableCell>
                            <StyledTableCell align="right">Address</StyledTableCell>
                            <StyledTableCell align="right">Actions</StyledTableCell>
                        </TableRow>
                        </TableHead>
                        <TableBody>
                            {
                                parkings.map(parking => (

                                <TableRow>
                                    <StyledTableCell component="th" scope="row">{parking.name}</StyledTableCell>
                                    <StyledTableCell align="right">Request Submitted</StyledTableCell>
                                    <StyledTableCell align="right">Commercial</StyledTableCell>
                                    <StyledTableCell align="right">10.00 am - 8.00 pm</StyledTableCell>
                                    <StyledTableCell align="right">Rs. 10/- per hour</StyledTableCell>
                                    <StyledTableCell align="right">loreum ipsum, 1st ma...</StyledTableCell>
                                    <StyledTableCell align="right">View</StyledTableCell>
                                </TableRow>

                                ))
                            }

                        </TableBody>
                    </Table>
                </TableContainer>
            </Fragment>
        )
    }
}


export default ParkingSpaceListView
